import React, { useState } from 'react';
import './index.css';

function App(){
    let str = "";
    let obj1 = {};
    const [obj, setTitle] = useState(obj1);
    function inputEvent(event){
        obj1.fname = event.target.value;
        obj1.sname = event.target.value;
        obj1.sname = event.target.value;
    }
    function change(){
        setTitle(obj => obj1);
    }
    return (<>
        <div>
            <h1>Hello {obj.fname} {obj.sname}</h1>
            <h2>{obj.email}</h2>
            <input type='text' placeholder='Enter your first name' name='fname'
                onChange={inputEvent}
            />
            <input type='text' placeholder='Enter your last name' name='sname'
                onChange={inputEvent}
            />
            <input type='text' placeholder='Enter your email' name='email'
                onChange={inputEvent}
            />
            <button onClick={change}>Submit</button>
        </div>
    </>);
}
export default App;
